CREATE TABLE "Comment" (
	"videoURL"	TEXT,
	"commentID"	INTEGER,
	"commenterID"	INTEGER,
	"commentText"	TEXT,
	"likes"	INTEGER,
	"sentiment"	INTEGER,
	FOREIGN KEY("videoURL") REFERENCES "Video"("videoURL"),
	FOREIGN KEY("commenterID") REFERENCES "User"("userID"),
	PRIMARY KEY("videoURL","commentID")
);

